import pytest
from problems.prob_567 import naive, not_generating_perms

tests = [
    (
        (
            "ab",
            "eidbaooo",
        ),
        True,
    ),
    (
        (
            "ab",
            "eidboaoo",
        ),
        False,
    ),
    (
        (
            "a",
            "ab",
        ),
        True,
    ),
    (
        (
            "adc",
            "dcda",
        ),
        True,
    ),
    (
        (
            "hello",
            "ooolleoooleh",
        ),
        False,
    ),
    (
        (
            "",
            "",
        ),
        True,
    ),
]


@pytest.mark.parametrize("args, expected", tests)
def test_0(args, expected):
    assert naive(*args) == expected


@pytest.mark.parametrize("args, expected", tests)
def test_1(args, expected):
    assert not_generating_perms(*args) == expected
